    "2016-05-25T00:44:04.872711",nt"name": "pilot-records-database",nt"isopen":
    true,nt"url": null,nt"notes": "Public Law 111-216, which enacted H.R. 5900,
    Airline Safety and Federal Aviation Administration Extension Act of 2010, mandated
    that the FAA create an information system containing FAA, Air Carrier, and National
    Driver Register (NDR) data for Air Carriers to be used in the pilot hiring decision
    process by Air Carriers. The PRD project includes business process creation and
    modification and as well as the complete life cycle of system development. The PRD
    will provide a centralized reliable source of historical information on pilots to
    enable Air Carriers to make hiring decisions. In addition to the IT project, a rulemaking
    project is underway that will issue regulations to protect and secure the personal
    privacy of any individual, and would require written consent from such individual
    before anyone accesses the records.",nt"license_title": "Other License Specified",nt"extras":
